values:
lets just talk about how i HAVE NOT HAD A CIGARETTE SINCE LIKE 2:00AM ON NEW YEARS!!!&nbsp;
yea, seems great, but i feel like shit.. im getting bitchy. im snapping at people for no reason. i dont wanna do ANYTHING. i hate this feeling. i mean, granted, its probably heightened cuz of other shits that has been goin on, but like, i feel like i NEED a cigarette. i knew it wasnt going to be easy, but i thought it would be easier than this. i feel like im going to literally rip someones head off if there is no distraction. im trying to decide if its better that i dont remember how that last one tasted.. hahah im such a fucknut. i never realized how addicted to this shit i was. i dont even know what im sayin anymore, so i should either stop talking or just light one up.. lol, just kidding :)

&nbsp;

if i have not gotten back to you after the countless missed calls and pathetic text messages you have sent me, i think its safe to say im not interested...&nbsp;
so no, Drew you have not left a profound impression on me and i am sorry that i apparently left one on you..&nbsp;
now leave me alone and GTFO of my life.. thank you : )
